// todo: 通过率90%，非动态规划算法，复杂度n2
func maxProfit(prices []int) int {

	n := len(prices)
	var (
		tmp = 0
		Max = 0
	)

	for i := 0; i < n; i++ {
		for j := i; j < n; j++ {
			tmp = prices[j] - prices[i]
			if Max < tmp {
				Max = tmp
				// println(Max, prices[j], prices[j-1])
			}
		}
	}

	return Max
}

// 贪心算法，复杂度n， 速度50%， 空间30%
// todo: 没有想到
func maxProfit2(prices []int) int {

	minV := math.MaxInt
	resV := 0
	tmpV := 0

	for i := 0; i < len(prices); i++ {
		if minV > prices[i] {
			minV = prices[i]
		}
		tmpV = prices[i] - minV
		if resV < tmpV {
			resV = tmpV
		}
	}
	return resV
}

// // 动态规划算法，复杂度n， 速度5%， 空间7%
// dp[i][0]应该选所得持有股票后的现金最大的，所以dp[i][0] = max(dp[i - 1][0], -prices[i]);
// dp[i][1]应该选取不持有股票取最大的，dp[i][1] = max(dp[i - 1][1], prices[i] + dp[i - 1][0]);
// todo: 完全没有想到
func maxProfit3(prices []int) int {
	n := len(prices)
	dp := make([][]int, n)
	dp[0] = append(dp[0], -prices[0], 0)

	i := 0
	for i = 1; i < n; i++ {
		if dp[i-1][0] < -prices[i] {
			dp[i] = append(dp[i], -prices[i])
		} else {
			dp[i] = append(dp[i], dp[i-1][0])
		}

		if dp[i-1][1] < prices[i]+dp[i-1][0] {
			dp[i] = append(dp[i], prices[i]+dp[i-1][0])
		} else {
			dp[i] = append(dp[i], dp[i-1][1])
		}

	}
	if dp[i-1][0] > dp[i-1][1] {
		return dp[i-1][0]
	} else {
		return dp[i-1][1]
	}
}

// 别人的代码
func maxProfit4(prices []int) int {
	length := len(prices)
	if length == 0 {
		return 0
	}
	dp := make([][]int, length)
	for i := 0; i < length; i++ {
		dp[i] = make([]int, 2)
	}

	dp[0][0] = -prices[0]
	dp[0][1] = 0
	for i := 1; i < length; i++ {
		dp[i][0] = dp[i-1][0]
		if dp[i-1][0] < -prices[i] {
			dp[i][0] = -prices[i]
		}
		dp[i][1] = dp[i-1][1]
		if dp[i-1][1] < dp[i-1][0]+prices[i] {
			dp[i][1] = dp[i-1][0] + prices[i]
		}
	}
	return dp[length-1][1]
}

